import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M12 18a1 1 0 001-1V5.41l1.3 1.3a1 1 0 001.31.08l.1-.08a1 1 0 00.08-1.32l-.08-.1-3-3a1 1 0 00-1.32-.08l-.1.08-3 3a1 1 0 001.32 1.5l.1-.08L11 5.4V17a1 1 0 001 1zm0 4a5 5 0 002-9.58v1.7a3.5 3.5 0 11-4 0v-1.7A5 5 0 0012 22z", fill: primaryFill }));
};
const SwipeUp24Filled = wrapIcon(rawSvg({}), 'SwipeUp24Filled');
export default SwipeUp24Filled;
